// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EHR {
    struct Patient {
        string name;
        uint age;
        string medicalHistory;
    }

    Patient[] public patients;
    mapping(address => uint) public patientIndex;

    function addPatient(string memory name, uint age, string memory medicalHistory) public {
        patients.push(Patient(name, age, medicalHistory));
        patientIndex[msg.sender] = patients.length - 1;
    }

    function getPatientCount() public view returns (uint) {
        return patients.length;
    }

    function getPatientByIndex(uint index) public view returns (string memory, uint, string memory) {
        require(index < patients.length, "Patient does not exist");
        Patient memory patient = patients[index];
        return (patient.name, patient.age, patient.medicalHistory);
    }

    function getPatient(address account) public view returns (string memory, uint, string memory) {
        uint index = patientIndex[account];
        Patient memory patient = patients[index];
        return (patient.name, patient.age, patient.medicalHistory);
    }
}
